import React, { useState } from "react";
import axios from "axios";
import './Login.css'
const Login = ({ handleLogin }) => {
  const [data, setData] = useState({
    email: "",
    password: "",
  });

  const handleChange = (e) => {
    const value = e.target.value;
    setData({
      ...data,
      [e.target.name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const userData = {
      email: data.email,
      password: data.password,
    };
    axios
      .post("https://reqres.in/api/login", userData)
      .then((response) => {
        console.log(response);
        handleLogin(true);
      })
      .catch((error) => {
        if (error.response) {
          console.log(error.response);
          console.log("server responded");
          alert("wrong");
        }
      });
  };
  return (
<body>
    <div class="wrapper">
      <div id="left">
        <div class="sign-in">
          <div class="logo">
            <img
              src=" https://image.ibb.co/hW1YHq/login-logo.png"
              alt="sluralpright"
            />
          </div>
          <form action="#">
            <div>
              <label for="">Email or Usename</label>
              <input type="text" class="text-input" value={data.email}
              onChange={handleChange} name="email" />
            </div>
            <div>
              <label for="">Password</label>
              <input type="password" class="text-input"  value={data.password}
              onChange={handleChange} name="password" />
            </div>
            <button onClick={handleSubmit} type="submit" class="btnn">Sign In</button>
          </form>
          <div class="links">
            <a href="#">Forget Password</a>
            <a href="#">Sign in with school or company</a>
          </div>
          <div class="or">
            <hr class="bar" />
            <span>OR</span>
            <hr class="bar" />
          </div>
          <a href="#" class="secondary-btn">Create an account</a>
        </div>
        <footer id="main-footer">
          <p>Copyright &copy; 2021, sluralpright All Right Reserved</p>
          <div>
            <a href="#">Terms of use </a> | <a href="#">Privacy Policy</a>
          </div>
        </footer>
      </div>
      <div id="right">
        <div class="showcase">
      
        </div>
      </div>
    </div>
  </body>
  );
};

export default Login
